import './App.css';
import { Button, Row, Col } from 'reactstrap';
function App() {
  return (
    <div className="App">
      <Row className="d-flex justify-content center">
        <Col sm="12" md="4">
          <Button>
            Teste
          </Button>
        </Col>
      </Row>
    </div>
  );
}

export default App;
